import React from 'react';
import { Container, Typography, Button, AppBar, Toolbar } from '@mui/material';
// import { Link } from 'react-router-dom'; // 如果你使用了 React Router，请确保导入 Link 组件
import LifeSimulation  from './LifeSimulation';


const LifeSimulationPage = () => {
  return (
    <div>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Game of Life - Simulation
          </Typography>
          <Button color="inherit" className="hoverButton">Home</Button>
          <Button color="inherit" className="hoverButton">Simulation</Button>
          <Button color="inherit" className="hoverButton">About</Button>
        </Toolbar>
      </AppBar>
      <Container>
     <LifeSimulation/>
     </Container>
    </div>
  );
};

export default LifeSimulationPage;
